import React from 'react';
import { Link } from 'react-router-dom';
import UpdateUser from '../pages/UpdateUser';

export default function AdminAction() {
  return (
    <ul className="nav nav-pills navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="/Admin">Admin</a>
        </li>
        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" data-bs-toggle="dropdown" href="#" role="button" aria-expanded="false">Update User</a>
          <ul class="dropdown-menu">
            <li><a class="dropdown-item" href="/UpdateUser">Delete User</a></li>
            {/* <li><hr class="dropdown-divider"/></li> */}
          </ul>
        </li>
        <li className="nav-item nav-pills">
          <Link to="/AddKeyword" aria-current="page" className="nav-link">Add Keyword</Link>
        </li>
      </div>
      
    </ul>
  );
}
